sys_variable_value.value:
(function execute(inputs, outputs) {

  try {
    const result = JSON.parse(inputs.response_body).result;
    outputs.status = result.status;
    outputs.status_label = result.status_label;
    outputs.status_message = result.status_message;
    outputs.status_detail = result.status_detail;
    outputs.percentage = result.percent_complete;
  } catch (e) {

  }

})(inputs, outputs);

